import RadioGroup from "../../common/RadioGroup";
import {useDispatch, useSelector} from "react-redux";
import {preferenceSelector} from "./selector";
import {updateVaccination} from "./action";

export default () => {
    const vaccinationRadio = [
        {
            name: "no-booster",
            label: "Yes w/o booster"
        },
        {
            name: "booster",
            label: "Yes, with booster"
        },
        {
            name: "no-vaccination",
            label: "Not vaccinated"
        },
        {
            name: "no-answer",
            label: "I prefer not to answer"
        }
    ]
    const dispatch = useDispatch();
    const { vaccination } = useSelector(preferenceSelector);

    const setVaccination = (target) => {
        const value = target.value;
        dispatch(updateVaccination(value));
    };
    return (
        <div id="DivFor_Covid">
            <div id="largemodal_Covid_1">
                <div id="largemodal_Covid_2">
                    <div id="largemodal_Covid_3">
                        <div className="card">
                            <div className="card-header">
                                <h4 className="card-title">Are you Covid 19 vaccinated ?* </h4>
                            </div>
                            <div className="card-body">
                                <ul className="list-group">
                                    <RadioGroup options={vaccinationRadio} name={'vaccination'} value={vaccination} updateValue={setVaccination}/>
                                </ul>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
